class Solution(object):    def minCostClimbingStairs(self, cost):        """        :type cost: List[int]        :rtype: int        """        pre,cur=cost[0],cost[1]        for i in range(2,len(cost)):            pre,cur=cur,min(pre,cur)+cost[i]        return min(pre,cur)s = Solution()cost = [1, 100, 1, 1, 1, 100, 1, 1, 100, 1]print(s.minCostClimbingStairs(cost))